class ToNamePage extends PureComponent {

	constructor(props) {
		super(props);
		this.data = {};
	}

	render() {
		return (
			<div style={styles.container}>

			</div>
		);
	}
}

const styles = {
	container: {},
};

export default ToNamePage;
